create table mobils (
	id  INT NOT NULL AUTO_INCREMENT,
	nopol VARCHAR(50),
	warna VARCHAR(50),
	biaya_sewa float,
	deskripsi varchar(255),
	cc VARCHAR(50),
	tahun VARCHAR(50),
	merk_id int,
	foto VARCHAR(255),
	PRIMARY KEY (id),
	CONSTRAINT FK_Mobil_Merk FOREIGN KEY (merk_id)
    REFERENCES merks(id)
);
